ow Up_51','Campbell\'s Computing Quote Follow Up','email','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body><span style=\"background-color: rgb(250, 250, 250); font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-weight: bold;\">Hello&nbsp;{name},</span>\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-weight: bold; font-size: 13px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; background-color: rgb(250, 250, 250);\"><br />\r\nI want to confirm that you received the quote I had sent over for the services you inquired about from Campbell&#39;s Cloud Computing. Please let me know if you have any questions or if you would like to schedule a phone call.<br />\r\n<br />\r\nThank you for considering Campbell&#39;s Cloud!</p>\r\n\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-weight: bold; font-size: 13px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; background-color: rgb(250, 250, 250);\">&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 1.5em; padding: 0px; border: 0px; font-weight: bold; font-size: 13px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; background-color: rgb(250, 250, 250);\">Cheers!<br />\r\n<br />\r\nCampbell&#39;s Cloud Team</p>\r\n</body>\r\n</html>\r\n','admin',1391731329,'','admin',1391731329,NULL);
